    @staticmethod
    def check_lower(value: SwapScript):
        if not isinstance(value, SwapScript):
            raise TypeError("Expected SwapScript instance, {} found".format(type(value).__name__))

    @staticmethod
    def lower(value: SwapScriptProtocol):
        if not isinstance(value, SwapScript):
            raise TypeError("Expected SwapScript instance, {} found".format(type(value).__name__))
        return value._uniffi_clone_pointer()

    @classmethod
    def read(cls, buf: _UniffiRustBuffer):
        ptr = buf.read_u64()
        if ptr == 0:
            raise InternalError("Raw pointer value was null")
        return cls.lift(ptr)

    @classmethod
    def write(cls, value: SwapScriptProtocol, buf: _UniffiRustBuffer):
        buf.write_u64(cls.lower(value))
